const Customer = () => {

  const { user } = useSelector(
    (state: RootState) => state.userReducer
  );

  const { data, isError, error } = useAllusersQuery(user?._id as string);

  //  console.log(data?.message)

  // const [data]= useState<datatype[]>(arr)
  const [rows,setrows]= useState<datatype[]>([]);

  if (isError) toast.error((error as CostomError).data.message);

  const [deleteUser] = useDeleteuserMutation();
  const deletehandler =async (userId: string) => {
    const res = await deleteUser({userId, adminUserId: user?._id as string});
    responseToast(res,null,'');

  };

  useEffect(()=>{
    if(data) setrows(data.message.map((i)=> ({
      avatar: <img src={i.photo}/>,
      name: i.name,
      gender: i.gender,
      email: i.email,
      role: i.role,
      action: <button onClick={()=>{deletehandler(i._id)}}><FaTrash/></button>
    })));
  },[data])

  const table = <TableHoc<datatype> columns={columns} data={rows} containerclassname="dashboardproductbox" heading="Customers"/>
    return (
      <>
        <div className="admincontainer">
      <Sidebar/>
      <main>
        {table}
      </main>
      </div>
      </>
    )
  }
  
  export default Customer